import './watched.css';
import React from 'react'
import {useMoviesContext}from '../context/GlobalContext';
import WatchedCard from './watchedcard/WatchedCard';
const Watched = () => {
  const watchedmovie=useMoviesContext();
  return (
    <div className='watched'>
      <div className="container">
        <div className="main-header">
          <h1>my watched</h1>
          <span>{watchedmovie.watched.length}</span>
        </div>
        <div className='watched-content'>
          {
            watchedmovie.watched.map((movie)=>{
              return(
                // <div className='movie' key={movie.imdbID}>
                //   <img src={movie.Poster} alt="" />
                // </div>
                <WatchedCard movie={movie} key={movie.imdbID} type="watched"/>
              )
            })
          }
        </div>
      </div>
    </div>
  )
}

export default Watched;
